import React, { Component } from 'react';


//props: 
// displayData: {name, region, season}


class Display extends Component {
    state = {  } 
    render() { 
        return (
            /** of class flex-container-display */
            <React.Fragment>

                <div class="flex-item-display flex-display-header">
                    <div class="header-title">{this.props.displayData.name}</div>
                    <div class="header-region">{this.props.displayData.region}</div>
                </div>

                <div class="flex-item-display">
                        Season: { this.props.displayData.season }
                </div>
            </React.Fragment>

        );
    }
}

export default Display;
